	int CGameMap::ScreenX(int x) {//x為地圖的點座標
		return (x - sx);			//回傳螢幕的點座標
	}

	int CGameMap::ScreenY(int y) {//y為地圖的點座標
		return (y - sy);			//回傳螢幕的點座標
	}

	bool CGameMap::IsEmpty(int x, int y) {
		int gx = x / MW;		//地圖格座標
		int gy = y / MH;
		return (map[gy][gx] == 1 || map[gy][gx] == 2 || map[gy][gx] == 3 || map[gy][gx] == 4 || map[gy][gx] == 5 || map[gy][gx] == 6 || map[gy][gx] == 7 || map[gy][gx] == 8 || map[gy][gx] == 10 || map[gy][gx] == 11);  // 設定1為空  
	}
	bool CGameMap::IsLittleMove_horizontal(int x, int y) {
		int gx = x / MW;
		int gy = y / MH;
		return (map[gy][gx] == 2);
	}
	bool CGameMap::IsLittleMove_updown(int x, int y) {
		int gx = x / MW;
		int gy = y / MH;
		return (map[gy][gx] == 5);
	}

	bool CGameMap::IsChangeScreen_horizontal(int x, int y) { 
		int gx = x / MW;
		int gy = y / MH;
		if(map[gy][gx] == 3)
			Stop_x = 50;
		return (map[gy][gx] == 3);
	}
	bool CGameMap::IsChangeScreen_Diagonal_RDandLU(int x, int y) { 
		int gx = x / MW;
		int gy = y / MH;
		if (map[gy][gx] == 4)
		{
			Stop_x = 50;
			Stop_y = 200;
		}
		if (map[gy][gx] == 11)
		{
			Stop_x = 335;
			Stop_y = 210;
		}

		return (map[gy][gx] == 4 || map[gy][gx] == 11);
	}
	bool CGameMap::IsChangeScreen_Diagonal_RUandLD(int x, int y) { 
		int gx = x / MW;
		int gy = y / MH;
		if (map[gy][gx] == 6) {
			Stop_x = 50;
			Stop_y = 150;
		}
		return (map[gy][gx] == 6);
	}
	bool CGameMap::IsStandingWood(int x, int y) { 
		int gx = x / MW;
		int gy = y / MH;
		return (map[gy][gx] == 7);
	}
	bool CGameMap::IsChangeScreen_UpOrDown(int x, int y) { 
		int gx = x / MW;
		int gy = y / MH;
		if(map[gy][gx] == 8)
			Stop_y = 150;
		return (map[gy][gx] == 8 );
	}

	bool CGameMap::IsPipe(int x, int y) {
		int gx = x / MW;
		int gy = y / MH;
		if (map[gy][gx] == 9) {
			Stop_x = 250;
			Stop_y = 200;
		}
		return (map[gy][gx] == 9);
	}
	bool CGameMap::IsScreenStopMoving(int x, int y) {
		int gx = x / MW;
		int gy = y / MH;
		return (map[gy][gx] == 10);
	}

	void CGameMap::OnMove(CEraser *c) {
		const int STEP_SIZE_L = 6;
		const int STEP_upL_SIZE = 10;
		const int STEP_downL_SIZE = 6;
		const int CHANGVIEW_SIZE_FOR_SX = 15;
		const int CHANGVIEW_SIZE_FOR_SY = 10;
		
		if (isMovingRight)
		{
			if (ScreenX(c->GetX1()) < Stop_x)
				isMovingRight = false;
			else sx += CHANGVIEW_SIZE_FOR_SX;
			//TRACE("%d\n", Stop_x);
		}
		if (isMovingLeft)
		{
			if (ScreenX(c->GetX1()) > Screen_Width - Stop_x)
				isMovingLeft = false;
			else sx -= CHANGVIEW_SIZE_FOR_SX;
		}
		if (isMovingDown)
		{
			if (ScreenY(c->GetY1()) <  Stop_y)
				isMovingDown = false;
			else sy += CHANGVIEW_SIZE_FOR_SY;
		}
		if (isMovingUp)
		{
			if (ScreenY(c->GetY1()) > Screen_Height - Stop_y)
				isMovingUp = false;
			else sy -= CHANGVIEW_SIZE_FOR_SY;		
		}
		
		//停止視角移動
			

        /////
		if (isMovingLeftL)
			sx -= STEP_SIZE_L;
		if (isMovingRightL)
			sx += STEP_SIZE_L;
		if (isMovingUpL)
			sy -= STEP_upL_SIZE;
		if (isMovingDownL)
			sy += STEP_downL_SIZE;

	}
